            $('input[name="ver_country_code"]').val($('.fogotpwd-form select[name="phone_countrycode"]').val());
            $('input[name="ver_phone"]').val($('.fogotpwd-form input[name="phone"]').val());
            $('#phoneVerificationModal .submit-btn').attr("showdiv", "#changepwd");
